import React from 'react';

const CardContainer = () => {
  return (
    <div style={{
      display: 'flex',
      flexDirection: 'row',
      justifyContent: 'space-between',
      alignItems: 'stretch',
      width: '100%',
      margin: '0 auto',
      boxSizing: 'border-box',
    }}>
      {/* First inner div with less width */}
      <div style={{
        width: '35%', // Smaller width
        height:'300px',
        backgroundColor: 'lightgray', // Just for visualization
        borderRadius:'10px'
      }}>
        First Div
      </div>

      {/* Second inner div with more width */}
      <div style={{
        width: '63%', // Larger width
        backgroundColor: 'darkgray', // Just for visualization
        borderRadius:'10px'
      }}>
        Second Div
      </div>
    </div>
  );
};

export default CardContainer;
